import React from 'react'
import Dashboardside from './Dashboardside'
import {Row, Col} from 'reactstrap';
const  Dashboard = () => {
    return (
        <div>
            <div className="row">
               <div className="col left col-md-3 col-sm-7" >
               <Dashboardside/>
               </div>
          
               <div className="col right col-md-8 col-sm-12" >
               Hello wolrld
               </div>
            </div>
           
        </div>
    )
}
export default Dashboard;
